import React, { Component } from "react";

class EY extends Component {	 
	render() {
		return (
            <div className='subheader'>
                <div className='major'>
                    <br></br>
                    <p>Ernest &amp; Young (EY) is one of the largest professional services firms in the world and provides advisory, assurance, risk and transaction services to over 200,000 clients in 150 countries.</p>
                    <p>EY's purpose in 'building a better working world' has increased trust and confidence in business, sustainable growth and development of talent in all forms and greater collaboration, evident through their tailored services and programs such as Entrepreneur Of The Year. This program empowers and aims to recognise the spirit of exceptional entrepreneurs who see things beyond the horizon by challenging orthodox methods and creating new markets for goods and services.</p>
                    <p>To align with the fast-changing trends of technology, EY has revolutionised how their organisation operates through collaborating to create pioneering services, powered by leading and emerging technologies including AI, blockchain, Internet of Things and cybersecurity. Thus, as new industries converge, EY is constantly creating new value and helping clients embrace the industry disruption as an opportunity.</p>
                </div>
                <br></br>
                <a href="https://www.ey.com/en_au" className="button" >Visit EY</a>
            </div>
        );
	}
}

export default EY;
